import React from "react";
import "./header.css";

function Icon() {
  <div className="icon">
    <a href="https://www.instagram.com">
      <i class="fa-brands fa-instagram"></i>
    </a>
  </div>;
}

const Header = () => {
  return (
    <div>
      <div className="wraper">
        <span>Welcome to Zuiz Business Services</span>
        <div className="icon-container">
          <div className="bar"></div>
          <a href="https://www.youtube.com">Follow Us</a>
          <div className="icons">
            <Icon />
          </div>
        </div>
      </div>
    </div>
  );
};

export default Header;
